#include <iostream>
#include <bits/stdc++.h>
using namespace std;

class Solution
{
public:
    int canCompleteCircuit(vector<int> gas, vector<int> cost)
    {
        ios::sync_with_stdio(false);
        cin.tie(nullptr);
        cout.tie(nullptr);
        vector<int> a(gas.size(), 0);

        for (int i = 0; i < gas.size(); i++)
        {
            a[i] = gas[i] - cost[i];
        }

        int j;

        int temp;

        for (int i = 0; i < a.size(); i++)
        {
            if (a[i] >= 0)
            {
                j = i;

                temp = 0;

                while (true)
                {
                    temp += a[j];

                    if (temp < 0)
                        break;

                    j = (j + 1) % a.size();

                    if (j == i)
                        break;
                }

                if (j == i)
                    return j;
                else
                {
                    if (i > j)
                        break;
                    i = j - 1;
                }
            }
        }

        return -1;
    }
};

